import './App.css';
import AddItemPage from './AddItemPage.js';
import UnauthenticatedView from './UnauthenticatedView.js';
import AuthenticatedView from './AuthenticatedView.js';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {

  return (
    <Router>
      <div>
        <Routes>
          <Route exact path='/' element={<UnauthenticatedView />} />
          <Route path='/loggedin' element={AuthenticatedView} />
          <Route path='/add' element={<AddItemPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
